Returns the last modification time of the file, in nanoseconds since [`st_mtime`].

[`st_mtime`]: Self::st_mtime

# Examples

```no_run
use std::fs;
use std::io;
use std::os::linux::fs::MetadataExt;

fn main() -> io::Result<()> {
    let meta = fs::metadata("some_file")?;
    println!("{}", meta.st_mtime_nsec());
    Ok(())
}
```
